import React, { Component } from 'react';
import {Link} from 'react-router-dom';

export default class LccLink extends React.Component {
  render() {
    return (
      <Link to="/RoadsAndTraffic" ><h3>Roads and traffic</h3>></Link>
    );
  }
}
